import { useState } from "react";

function App() {
  return (
    <div className="App">
      <MainHeader>
        <Heading></Heading>
        <Logo></Logo>
        <Search></Search>
      </MainHeader>
    </div>
  );
}

export default App;

function MainHeader({ children }) {
  return (
    <div>
      <main>{children}</main>
    </div>
  );
}

function Logo() {
  return (
    <div>
      <img src="Logo.png" alt=""></img>
    </div>
  );
}
function Heading() {
  return (
    <header className="header">
      <h1 style={{ color: "white" }}>ShopHubâ€¢</h1>
    </header>
  );
}

function Search() {
  const [search, setSearch] = useState();
  return (
    <div>
      <input
        className="Search"
        type="text"
        placeholder="Search here...."
        value={search}
        onChange={(e) => setSearch(e.target.value)}
      ></input>
    </div>
  );
}
